import React from "react";
import SideLogo from "./sideLogo";
import SideProfile from "./sideProfile";

const SideNav = () => {
  return (
    <React.Fragment>
      <SideLogo />
      <SideProfile />
      <h1>Side Nav</h1>
    </React.Fragment>
  );
};

export default SideNav;
